// loggingMiddleware.js
import axios from 'axios';

const ACCESS_TOKEN = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..6J8sfkUkgZ82akbX4bvmzbW471mAQY4kiPPlw8akMQA';

export async function Log(stack, level, packageName, message) {
  try {
    const body = {
      stack: stack.toLowerCase(),
      level: level.toLowerCase(),
      package: packageName.toLowerCase(),
      message: message,
    };

    const headers = {
      Authorization: `Bearer ${ACCESS_TOKEN}`,
    };

    await axios.post('http://20.244.56.144/evaluation-service/logs', body, { headers });
    console.info(`Log sent: ${message}`);
  } catch (error) {
    console.error(`Failed to send log: ${error.message}`);
  }
}
